import React from 'react';
import Todos from './components/Todos';

function App() {
  state = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        ompleted: false
      },
      {
        id: 1,
        title: 'Take out the trash',
        ompleted: false
      },
      {
        id: 1,
        title: 'Take out the trash',
        ompleted: false
      },
    ]
  }

  return (
    <div className="App">
      <Todos />
    </div>
  );
}

export default App;
